import React from "react";
import Card from "./Card";

const CardList = ({data}) =>{
    return(
        <div>
            {data.map((data, i) => {
                return (
                    <Card
                        key={i}
                        id={data[i].id}
                        name={data[i].name}
                        username={data[i].capital}
                        email={data[i].region}
                    />
                )
            })
            }
        </div>
    )
};

export default CardList;
